	('b253058d-5cbc-46da-8b67-8c9b26c13b76', 'Basic Nursing Interview', 'published', 1, 1, 'Thank you for completing the interview.', '{"Ask follow-up questions if needed","Provide clear instructions"}', 30, 'Why did you choose nursing as a career?', 'Welcome to the nursing interview!', '30 minutes', '{"fields": [{"name": "full_name", "type": "text", "required": true}]}', '{"Answer all questions","Take your time"}', '/images/instructions-cover.png', 'https://resource.heygencdn.com/AIAvatars/caption.mp4', '{"This interview will assess your skills"}', '2024-10-13 10:15:35.124397+00', '2024-10-13 10:15:35.124397+00', 'e7d5ff76-fab3-444b-be00-9fca3e0185c2'),
	('b253058d-5cbc-46da-8b67-8c9b26c13b77', 'Basic Nursing Interview', 'published', 1, 1, 'Thank you for completing the interview.', '{"Can you tell me about your nursing background and what inspired you to pursue a career in nursing?","What areas of nursing have you specialized in, and why did you choose those specialties?","How do you prioritize patient care when dealing with multiple patients with different levels of acuity?","Can you describe a time when you had to handle a medical emergency? What steps did you take, and what was the outcome?","How do you stay updated with the latest medical advancements and practices in nursing?","You’re working with a patient post-surgery, and they suddenly report difficulty breathing. What immediate actions would you take?","You notice that a patient’s medication dosage is incorrect on the chart. What steps would you follow to resolve this issue?","How do you handle conflict within a healthcare team, especially when it comes to differences in patient care approaches?","Can you give an example of how you''ve collaborated with doctors or other healthcare professionals to improve patient outcomes?","How do you ensure that patients feel comfortable and cared for during their hospital stay?","Describe a time when you provided emotional support to a patient or their family during a difficult situation.","What do you think is the most important quality a nurse should possess, and how do you embody that in your work?","How do you maintain work-life balance while working in a demanding healthcare environment?","What are your career goals in nursing, and how do you see yourself growing in this profession?"}', 30, 'Why did you choose nursing as a career?', 'Welcome to the nursing interview!', '30 minutes', '{"fields": [{"name": "full_name", "type": "text", "required": true}]}', '{"Answer all questions","Take your time"}', '/images/instructions-cover.png', 'https://resource.heygencdn.com/AIAvatars/caption.mp4', '{"This interview will assess your skills"}', '2024-10-13 10:15:35.124397+00', '2024-10-13 10:15:35.124397+00', 'e7d5ff76-fab3-444b-be00-9fca3e0185c2');
